import React from "react";
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import { useNavigate } from "react-router-dom";

function Jobs(){

    const navigate = useNavigate();

    function navigation(){
        navigate('/home');
    }

    return(
        <div class ="button container-fluid">
            <div class = "heading row" >
                <div class = "col-sm-12 line1 text-center">
            <b>Jobs</b>
                </div>
                <div class = "col-sm-3 text-center line2">
                <Card style={{ width: '18rem' }}>
            <Card.Img variant="top" src = {require('../Images/image1.png')}/>
            <Card.Body>
            <Card.Title><b>Current Openings</b></Card.Title>
            <Card.Text>
            <div>Barista</div>
            <div>Manager</div>
            <div>Supervisor</div>

            </Card.Text>
            <Button variant="primary"  onClick={navigation}>Home</Button>
      </Card.Body>
    </Card>
                </div>

            </div>

        </div>
    )
}



export default Jobs
